def reverse_string(s):
    List = []
    Reversed_list = []
    for i in range(len(s)):
        List.append(s[i])
    for i in range(len(s)):
        Reversed_list.append(List[len(s) - i - 1])
    result = ''.join(['"']+Reversed_list+['"'])
    return result

